def get_authors(subreddit, start_post, end_post):
    authors = {}
    subreddit = reddit.subreddit(subreddit)
    posts = subreddit.new(limit=end_post+1)
    for i, post in enumerate(posts):
        if i < start_post: continue
        print(post.title)
        print(datetime.datetime.fromtimestamp(post.created_utc).strftime('%l:%M%p %Z on %b %d, %Y'))
        # Get comments
        submission = reddit.submission(id=post.id)
        submission.comments.replace_more(limit=None)
        for comment in submission.comments.list():
            if not comment.author: continue
            author = comment.author.name
            if author not in authors:
                authors[author] = 0
            authors[author] += 1
    return authors

